import { useEffect } from 'react';
import profileImage from '../Assets/profile.png';
import './css/Circle.css';
import facebooksvg from '../Assets/icons8-facebook.svg';
import Githubsvg from '../Assets/icons8-github.svg';
import Gmail from '../Assets/icons8-gmail.svg';
import LinkedIN from '../Assets/icons8-linkedin-logo.svg';

const CirclePage = () => {
  useEffect(() => {
    const socialLinks = document.querySelectorAll('.Social_link a');
    socialLinks.forEach(link => {
      const newPositionX = Math.random() * 500; // Adjust as needed
      const newPositionY = Math.random() * 300; // Adjust as needed
      link.style.transform = `translate(${newPositionX}px, ${newPositionY}px)`;
    });
  }, []); // Run once on component mount

  return (
    <div className="Section"> 
      <div className='Middle'>
        <h1>Hello Dev</h1>
        <h2>I am Subarna Dahal</h2>
      </div>
      <a href='https://www.facebook.com'><img src={facebooksvg} alt="Facebook" /></a>
        <a href='https://www.github.com'><img src={Githubsvg} alt="Github" /></a>
        <a href='mailto:example@gmail.com'><img src={Gmail} alt="Gmail" /></a>
        <a href='https://www.linkedin.com'><img src={LinkedIN} alt="LinkedIn" /></a>
      <div className='image-container'>
        <div className='circular-border'></div>
        <img src={profileImage} alt="subarna" className="profile-image" />
      </div>
    
        <a href='https://www.facebook.com'><img src={facebooksvg} alt="Facebook" /></a>
        <a href='https://www.github.com'><img src={Githubsvg} alt="Github" /></a>
        <a href='mailto:example@gmail.com'><img src={Gmail} alt="Gmail" /></a>
        <a href='https://www.linkedin.com'><img src={LinkedIN} alt="LinkedIn" /></a>
      <div className='programming'>
        <h3>Programming Knowledge:</h3>
        <ul>
          <li>React</li>
          <li>Node</li>
          <li>Express</li>
          <li>Javascript</li>
          <li>Python</li>
          <li>Mongodb</li>
          <li>MySQL</li>
        </ul>
      </div>
    </div>
  );
}

export default CirclePage;
